import React,{Component} from 'react';
import "./Room.css";
import BuildControl from "../BuildControl/BuildControl"

const Room = (props) => {
  return  <div className="room">
		<div className="title">{props.data.name}</div>
		<BuildControl />

	</div>
}

export default Room;
